import './App.css';

function VocabCard(props) {
  return (
    <div className="VocabCard">
      <h3>{props.characters}</h3>
      <h3>{props.romaji}</h3>
      <h3>{props.type}</h3>
      <h3>{props.meaning}</h3>
      
    </div>
  );
}

export default VocabCard;
